For the record, another test case:

    package main

    import (
	    "fmt"
	    "reflect"
    )

    type MyType int

    func (m MyType) UniqueMethodName() {
	    fmt.Println("My unique method string")
    }

    var v MyType

    func main() {
	    reflect.ValueOf(v).Method(0).Interface().(func())()
    }
